import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div class="Menu">
            <ul>
              <li class="Active">
                <ul class="MenuCRS">
                  <li class="CRS">
                      SignIn
                  </li>
                  <li class="CRS">
                      Contact
                  </li>
                </ul>
              </li>
            </ul>
          </div>
      </header>
    </div>
  );
}


export default App;
